/* empty css                                */const l=()=>{const a=document.querySelector("[data-tab-nav]");if(a){const c=document.querySelectorAll("[data-tab-btn]"),s=document.querySelectorAll("[data-tab-panel]");a.addEventListener("click",o=>{const e=o.target.closest("[data-tab-btn]");if(!e)return;const r=e.dataset.tabBtn??"",n=document.getElementById(r);c.forEach(t=>t.classList.toggle("isActive",t===e)),s.forEach(t=>t.classList.toggle("isActive",t===n))})}};l();
